import image1 from '../images/1.png';
import image2 from '../images/2.jpg';
import image3 from '../images/3.jpg';
import image4 from '../images/4.jpg';
import image5 from '../images/5.jpg';



const images = [{
    id: 1,
    src: image1,
    alt: "Image 1"
  },
  {
    id: 2,
    src: image2,
    alt: "Image 2 "
  },
  {
    id: 3,
    src: image3,
    alt: "Image 3"
  },
  {
    id: 4,
    src: image4,
    alt: "Image 4 "
  },
  {
    id: 5,
    src: image5,
    alt: "Image 5"
  }
];
export default images;
